func getIcons(ids []string) map[string]string {
	ret := make(map[string]string, len(ids))
	for _, id := range ids {
		v, ok := iconMap[id]
		if !ok {
			log.Warnf("unknown id icon, id: %v", id)
			continue
		}

		ret[id] = v
	}

	return ret
}

